        min_val = float('inf')
        max_val = float('-inf')

        for i in range(len(A)):
            if K < 0:
                K += 2**(i) - 1
            elif K > 0:
                K -= 2**(i) + 2
            else:
                A[i] += 2**(i)
                K += 2**(i)

            if min_val < A[i]:
                min_val = A[i]
            if max_val > A[i] + min_val:
                max_val = A[i] + min_val

